    for case in test_cases:
        (N, A) = case
        (ones, zeros) = (0, 0)
        (isone, iszero) = (False, False)
        i = 1
        while i < N:
            if A[i] == 1:
                isone = True
            else:
                iszero = True
            tmp = 0
            if A[i] == A[i - 1]:
                while i < N and A[i] == A[i - 1]:
                    i += 1
                    tmp += 1
                i -= 1
                if A[i] == 0:
                    zeros += tmp
                else:
                    ones += tmp
            i += 1
        if N > 2 and A[0] == A[-1]:
            if A[0] == 1:
                ones += 1
            else:
                zeros += 1
        if ones == 1 or zeros == 0:
            results.append('Bob')
            continue
        if min(ones, zeros) % 2:
            results.append('Alice')
        else:
            results.append('Bob')
    return results

